// AttendancePage.js
import React, { useState } from "react";
import { TextField, Button, Container, Grid } from "@mui/material";

const Add = () => {
  return (
    <div>
      <div className="add">
        <input type="text" placeholder="Enter Name"></input>
        <input type="text" placeholder="Enter Roll.no"></input>
        <input type="text" placeholder="Enter Section"></input>
        <input type="text" placeholder="Enter Branch"></input>
        <input type="text" placeholder="Mobile.No"></input>
        <input type="text" placeholder="Father's Name"></input>
        <input type="text" placeholder="Address"></input>
        <input type="text" placeholder="Collage Name"></input>
      </div>
    </div>
  );
};

export default Add;
